-- ----------------------------
-- Table structure for book
-- ----------------------------
DROP TABLE IF EXISTS `book`;
CREATE TABLE `book`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '图书名称',
  `author` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '作者',
  `publisher` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '出版社',
  `isbn` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'ISBN编号',
  `stock` int(0) NULL DEFAULT 0 COMMENT '库存数量',
  `publish_time` date NULL DEFAULT NULL COMMENT '出版日期',
  `category_id` bigint(0) NULL DEFAULT NULL COMMENT '分类ID',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '图书简介',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `cover_url` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '图书封面地址',
  `price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '定价',
  `location` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '图书位置',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 34 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '图书表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of book
-- ----------------------------
INSERT INTO `book` VALUES (11, '我以为这辈子完蛋了', ' [美]艾莉·布罗什', '花城出版社', '9787574904101', 0, '2025-05-08', 11, '这是一本自传式漫画散文集，讲述作者艾莉从小到大发生的各种搞笑的、难过的和困惑的事。在写这本书时，艾莉的生活遭遇了许多“完蛋时刻”——离婚、被误诊癌症、妹妹去世——生活的暴击让她不断追问人生到底有什么意义，如果没有意义，又该如何面对？这也是这本书里贯穿始终的问题。\n\n“ 有时候，你只能继续往前走，祈祷自己最终能找到一丁点道理。”\n\n艾莉就是这样，在经历无数个以为会完蛋的瞬间之后，还是勇敢地往前走着。\n\n狂野怪诞的画风，孩子气的坦率文字，加上剂量充足的真实，让人大笑，让人感动，让人思考自己的存在。看似简单的寥寥数笔，描画出人性共通的复杂情绪。看着看着，你会惊呼：“我也是啊！”\n\n* 豆瓣8.4高分漫画《我永远也当不了大人》第二弹！\n\n* Goodreads 2020年度幽默图书奖提名\n\n* 一本具备文学性的成人漫画，有17个故事、1600张图，有狗、猫、青蛙和马粪，...', '2025-05-08 10:11:23', '2025-05-08 14:23:22', 'data:image/jpeg;base64,', 78.00, '二楼A区-3排-1层');
INSERT INTO `book` VALUES (12, '中国的西北角', '范长江 著 / 范东升 编', '北京出版社', '9787200189728', 4, '2025-05-15', 10, '·本书最大特色是范长江次子范东升教授对本书所收录的经典文章详加考证与勘注，纠正了以往各版本中的差错数百处，为读者提供了迄今为止最为完整、可靠和准确的版本。\n\n·范东升教授为本书添加了一千余条注释，为当今读者理解书中内容提供了很大的方便。\n\n·范东升教授制作了范长江西北考察行程一览表，详细列出各旅行阶段的时间、地点、路线、作品等，可使读者对长江先生的行程信息一览无余。\n\n·为了便于读者理解书中内容，范东升教授在原版书旧图基础上，考证地理资料，重新绘制四十余幅地图，对原图中的一些差错也给予了纠正。本书中的新资料十分丰富，可为读者提供很大的便利。\n\n内容简介\n\n《中国的西北角》和《塞上行》是我国新闻界公认的经典作品。为帮助读者正确地理解这两部书的内容，以及客观地认识范长江的新闻生涯，范东升教授经过勘校注释和补充文章，重新出版《中国的西北角》和《塞上行》的勘...', '2025-05-08 10:13:42', '2025-05-08 14:23:28', 'data:image/jpeg;base64,', 198.00, '一楼A区-3排-5层');
INSERT INTO `book` VALUES (13, '波斯中国风', '[日] 門井由佳', '中西书局', '9787547521755', 8, '2025-05-22', 9, '✨以丰富的史实案例，描摹800年前两大古老文明间的艺术碰撞；\n\n✨以敏锐的学术洞察，对波斯艺术中中国元素的首次系统梳理；\n\n✨打破 “西方中心论”的偏见，凸显东方艺术的全球影响和贡献；\n\n✨130余幅高清彩图，完美呈现艺术品中的纤毫细节，探寻每一处中国风痕迹；\n\n✨重点信息突出显示，帮助读者迅速把握内容要旨，体会艺术审美背后的文明交融。\n\n————\n\n由于丝绸之路的延展开拓，中国与波斯的贸易往来古已有之，并在13世纪蒙古时期达到了巅峰，两大古老文明间的碰撞交流使这一时期的艺术成为伊朗艺术史上极为精彩的一叶。当时的织物、瓷器、绘画等艺术形式中均包含着对中国艺术元素、风格、技法等的借鉴，呈现出浓郁的中国风。英国爱丁堡大学的艺术史学家門井由佳以敏锐的学术眼光发掘了这一课题，逐一分析伊朗艺术作品对中国主题的运用过程，为伊朗和中国之间的艺术互动历史研究寻找到新的视角，为中...', '2025-05-08 10:15:40', '2025-05-08 14:23:33', 'data:image/jpeg;base64,', 198.00, '二楼A区-4排-5层');
INSERT INTO `book` VALUES (14, '阿拉伯人的大航海', '[英] 乔治·胡拉尼', ' 光启书局', '9787545220216', 5, '2025-05-15', 9, '☆早在欧洲人之前，阿拉伯人就已经开启人类的大航海时代\n\n☆东方研究权威乔治·胡拉尼著作首次引进\n\n☆历史学者刘迎胜、朱明推荐\n\n内容简介：\n\n如果说郑和下西洋、欧洲开辟新航路是人类航海史的正午，那么阿拉伯人的航海就是黎明。他们迈出了人类从陆地走向近海，再走向远洋的关键步伐：从利用兽皮树干到伐木造船，从划桨到竖起桅杆和风帆，从沿海岸线航行到利用季风横渡大洋。阿拉伯人建立了西至地中海、东非，东到中国的海上交通网和文明交流的通道，他们以先进的航海技术，促进了物质、文化、观念的跨区域传播。\n\n本书拨开传说的迷雾，再现阿拉伯人从朦胧史前到中世纪黄金时代的航海历史。阿拉伯人与腓尼基人、希腊人、非洲人的竞争交流，红海与波斯湾航线的开辟，中国史书中广州与泉州的“大食人”，《一千零一夜》等经典文献中的航海故事，古代帆船的历史图片和考古发现，海盗、商人与军队的海上活动...', '2025-05-08 10:16:51', '2025-05-08 14:23:43', 'data:image/jpeg;base64,', 89.00, '二楼A区-3排-1层');
INSERT INTO `book` VALUES (15, '国家公园', '安吉拉·艾朵斯', '湖南科学技术出版社', '9787571025847', 2, '2025-05-15', 8, '※ 中国国家地理×意大利白星出版社联袂打造，精选全球56个国家公园，打造沉浸式“纸上纪录片”。\n\n从亚洲的三江源到北美洲的黄石，精选56处宝藏秘境，让读者纸上环游地球。\n\n※ 独家收录中国五大国家公园，发现中国的自然宝藏！\n\n《中国国家地理》杂志资深作者、摄影师联合创作，从大熊猫的栖息地到海南热带雨林，书中特别介绍了中国五大国家公园：三江源国家公园、大熊猫国家公园、东北虎豹国家公园、武夷山国家公园、海南热带雨林国家公园。\n\n一本书带你探寻六大洲的56处自然宝藏。\n\n本书是“美丽的地球”系列译作，以六大洲56个标志性国家公园为脉络，跨越沙漠、雨林、冰川、火山等多种生态系统，集自然科学、人文历史与视觉艺术于一体，构建出一座纸上的环球自然博物馆。\n\n书中系统梳理了各国国家公园及自然保护区的百年发展脉络，介绍了全球各地珍贵而美丽的野生动植物，精选600余幅震撼级摄影作品...', '2025-05-08 10:19:04', '2025-05-08 14:23:50', 'data:image/jpeg;base64,', 98.00, '二楼A区-3排-1层');
INSERT INTO `book` VALUES (16, '水浒传', '施耐庵 / 罗贯中', '人民文学出版社', '9787020125579', 5, '2025-05-16', 10, '《水浒传》，又称《水浒》、《忠义水浒传》、《水浒全传》，是中国古典章回小说“四大名著”之一，由施耐庵、罗贯中合著。《水浒传》叙述了北宋末年以宋江为首的英雄人物在梁山水泊聚众起义的故事。小说通过生动的艺术描写反映了梁山英雄起义从发生、发展到失败的全过程。它深刻地挖掘了起义的社会根源，成功地塑造了起义英雄的群像，也具体地揭示了起义失败的内在原因。另外为便于读者阅读，本书选配了名家戴敦邦所绘彩色插图20幅附于书中，同时编制了“《水浒传》英雄谱”。', '2025-05-08 10:20:01', '2025-05-08 14:23:55', 'data:image/jpeg;base64,', 195.00, '二楼A区-3排-1层');
INSERT INTO `book` VALUES (29, '安徒生童话与故事全集', '[丹] 安徒生', '上海译文出版社', '9787532795567', 2, '2025-05-23', 11, '2025年4月2日是“童话之父”安徒生诞辰220周年，也正逢中丹两国建交75周年，上海译文出版社隆重推出《安徒生童话与故事全集》，作为安徒生220周年纪念版和读者朋友见面。\n\n全书根据丹麦汉斯·雷兹尔斯出版社1992年纪念版译出，收入安徒生传世童话故事157篇，丹麦画家威廉•佩德森及洛伦兹•弗罗里希插画作品500余幅，“国际安徒生大奖”“丹麦国旗勋章”“翻译终身成就奖”获得者、北欧文学研究专家石琴娥丹麦文直译，时任丹麦王国驻华大使、欧登塞安徒生博物馆撰序。', '2025-05-09 11:10:17', NULL, 'data:image/jpeg;base64,', 598.00, NULL);
INSERT INTO `book` VALUES (30, '莎士比亚时代的英格兰', ' [英] 杰里米·布莱克', '上海书店出版社', '9787545824100', 2, '2025-05-16', 11, '《莎士比亚时代的英格兰》聚焦莎士比亚的写作背景和观众的观剧背景，展示了莎士比亚同时代的人们是如何看待莎翁剧中的命运、复仇、爱情、政治、公正及他人，为当代读者理解莎士比亚戏剧呈现了还原的历史化的语境。作者将早期现代英格兰的政治、经济、社会、风俗、国际背景和文化一一道来，与莎士比亚戏剧的章节原段互相印证，带领读者进入那个科学与魔法并存、不同信仰各异、人们的眼界和所接收的信息爆炸式增长、城乡发展迅速，社会文化缤纷多彩的——莎士比亚时代的英格兰。\n\n本书共十三个章节。分别叙述了莎士比亚时代的世界观（宗教、科学与神秘主义，第一章）、地理风貌（第二章）、经济发展（第三章）、城市变化（第四章）、从兰开斯特到都铎王朝的历史承继（第五、六、七章）、社会变迁（第八章）、医学知识（第九章）、信息媒介（第十章）、欧洲背景（第十一章）、航海发现（第十二章）和莎士比亚在后世引起的...', '2025-05-09 11:12:04', NULL, 'data:image/jpeg;base64,', 98.00, ' 上海书店');
INSERT INTO `book` VALUES (31, '反卷社会', '[美] 阿夫拉姆·阿尔珀特（Avram Alpert）', ' 中国科学技术出版社', '9787523608050', 2, '2025-05-09', 8, '本书向我们描述了应如何超越对伟大的追求，创造出一个人人都能有所作为的社会。\n\n我们生活在以追求伟大、拔尖为导向的社会中。在这样的社会里，我们被迫要努力跻身最富裕、最有权势以及最有名的人士之列。阿尔珀特向我们表明了，没有人能够真正从这种竞争性社会秩序中获益，我们对于追求伟大的痴迷会导致压力与焦虑，会破坏我们的人际关系，会引发广泛的政治与经济不平等，还会破坏自然界。通过减少与彼此的竞争，我们所有人都能重新找到生活的意义与目标，满足物质与情感需求，并开始过上更为闲适的生活。\n\n以拔尖和过度犒赏少数人为由，忽视大多数人的价值和才能，使我们生活的世界陷入了焦虑与困境。\n\n我质疑这种优胜劣汰的社会秩序，它利用我们的才华, 将其转变为一种欲望, 促使我们争取在竞争性等级次序的顶端赢得一席之地。\n\n追求拔尖这场游戏的风险之一在于, 如果你取得了胜利, 你就会开始为你在等级次...', '2025-05-09 11:13:03', '2025-05-09 11:13:15', 'data:image/jpeg;base64,', 76.00, '	 二楼A区-3排-1层');
INSERT INTO `book` VALUES (32, '格外的活法', '[日] 吉井忍', '文汇出版社', '9787549639762', 1, '2025-05-16', 8, '“路变窄了，但还可以走”\n\n日籍华语作家吉井忍全新力作\n\n在不那么完美的日子，守住那份“标准规格之外”的自由\n\n【内容简介】\n\n在极致追求效率的社会，总会 有人站在时代前列，发挥先锋模范的作用，写出激发人心的励志故事。但我们在生活中也会遇到一种人，她/他会让你叹赏：对于自己的人生，竟可以做出这样的选择。\n\n作家吉井忍走入日本的大街小巷，历时七年，采访各行各业的普通人，探访12种主流秩序外的格外活法。\n\n有人早上起床在东京街头回收垃圾，晚上在剧场讲段子引得众人发笑，“世上没有所谓的垃圾，但一旦扔掉，它就变成垃圾了。”\n\n有人离开日本面积最大的书店，在南方小岛开了家日本面积最小的旧书店，发现“一旦离开公司职员身份，我真的就一个人了”。\n\n有人19年盖一栋楼，从自己动手浇灌混凝土开始，在只鼓励人成为“消费者”的社会当一个“创造者”……\n\n这些人可能是你的邻居，或商店街角落中...', '2025-05-09 11:14:12', '2025-05-09 17:10:45', 'data:image/jpeg;base64,', 79.00, '2');

-- ----------------------------
-- Table structure for book_borrow
-- ----------------------------
DROP TABLE IF EXISTS `book_borrow`;
CREATE TABLE `book_borrow`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '借阅记录ID',
  `book_id` bigint(0) NOT NULL COMMENT '图书ID',
  `user_id` bigint(0) NOT NULL COMMENT '读者ID',
  `status` tinyint(0) NOT NULL DEFAULT 0 COMMENT '借阅状态：0申请中 1已借出 2已拒绝 3已归还',
  `borrow_date` datetime(0) NOT NULL COMMENT '借阅日期',
  `return_date` datetime(0) NULL DEFAULT NULL COMMENT '归还日期',
  `approval_date` datetime(0) NULL DEFAULT NULL COMMENT '审批日期',
  `rejection_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '拒绝原因',
  `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '记录创建时间',
  `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '记录更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `book_id`(`book_id`) USING BTREE,
  INDEX `user_id`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 43 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '图书借阅记录表' ROW_FORMAT = Dynamic;

