INSERT INTO `system_notice` VALUES (1, '22', '222222222222111111111', 1, 1, '2025-05-08 11:55:36', '2025-05-08 11:55:55', '2025-05-09 13:46:18', NULL);
INSERT INTO `system_notice` VALUES (2, '1111111111111111', '1111111111111', 1, 1, '2025-05-08 12:45:52', '2025-05-08 12:45:54', NULL, NULL);
INSERT INTO `system_notice` VALUES (3, '钱钱钱', '水水水水水水水水水水', 1, 1, '2025-05-08 15:52:58', '2025-05-08 15:53:03', NULL, NULL);
INSERT INTO `system_notice` VALUES (4, '读书活动', '施瑞伯《一名神经疾病患者的回忆录》（下文简称《回忆录》）想必是所有精神病学文献中被评论最多的一部，多年来已经积累了大量的书籍文章，主要以德语和英语文献为主。历代精神病学作者都把这本书当作后继提出的...', 1, 1, '2025-05-08 16:47:48', '2025-05-08 16:48:07', NULL, 'data:image/jpeg;base64,');
INSERT INTO `system_notice` VALUES (5, '读书专题-1', '是是深刻的思考的接口', 1, 1, '2025-05-09 13:45:44', '2025-05-09 13:46:01', NULL, NULL);
INSERT INTO `system_notice` VALUES (6, '世界读书日', '“老人并没有返老还童，而是被放射性物质夺走了死亡能力。”\n\n核灾难降临之后，日本处于外来语、网络都消失的锁国状态，被剥夺死亡权利的老人，依然健康，还要工作，而原本代表希望的年轻人却不断患病，命悬一线。拥有不死之身的老人，注定要目送一代代子孙走向死亡……\n\n面对停滞的世界，老人们决心冲破锁国残局，拯救孩子们，他们成立了神秘组织，挑选现代日本的遣唐使——“献灯使”，重新建立和世界的联系。\n\n主人公义郎的后代无名，一名柔软如章鱼，声音如白鹤的聪明少年，正是zui佳人选。而无名能否完成任务，在末日死里逃生，等待新世界到来……\n\n本书共收录5篇同题材作品。', 1, 1, '2025-05-09 13:47:33', '2025-05-09 13:47:56', NULL, 'data:image/jpeg;base64,');

